import React, { Component } from "react";
import "./index.css";
export default class Header extends Component {
  handleKeyUp = (e) => {
    if (e.keyCode === 13) {
      if (e.target.value.trim() !== "") {
        this.props.b({ id: Date.now(), name: e.target.value, done: false });
        e.target.value = "";
      } else {
        alert("do something");
      }
    }
  };
  render() {
    return (
      <div className="header">
        <div className="input" onKeyUp={this.handleKeyUp}>
          <input type="text" />
        </div>
        <button>+</button>
      </div>
    );
  }
}
